import React from 'react';


export type TasksType={
    task: string,
    id:string,
    description:string,
    checked:boolean,
}

export type ToDoListType = {
    title: string,
    tasks: Array<TasksType>,
}


export function ToDoList({ title, tasks }: ToDoListType) {

    let mapFunction = tasks.map((el:any) => { return <li><input type="checkbox" checked={el.checked} /> <span>{el.task}</span></li> })
    return (
        <div className="App">
            <div>
                <h3>{title}</h3>
                <div>
                    <input />
                    <button>+</button>
                </div>
                <ul>
                    {mapFunction}
